import React from 'react';

// const Header = () =>{
//     return <h2> This is header</h2>
// }

class Header extends React.Component{
  render(){
      return(
          <header>
              <div className="logo" onClick={console.log("input clicked")}>LOGO</div>
              <input></input>
          </header>
      )
  }
}

export default Header;
